import { StyleSheet } from "react-native";
import { blue100 } from "react-native-paper/lib/typescript/styles/colors";

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    image: {
        flex: 0.7,
        justifyContent: 'center'
    },
    title: {
        fontWeight: '800',
        fontSize: 28,
        marginBottom: 10,
        color: blue100,
        textAlign: 'center'
    }
})

export default styles;
